

class FraxHelper {


  static double calculateBMI(double weight, double height) {
    // Convert height from cm to meters
    double heightInMeters = height / 100;
    double bmi = weight / (heightInMeters * heightInMeters);

    // Round BMI to 2 decimal places
    return double.parse(bmi.toStringAsFixed(2));
  }


 static int roundToNearestFive(int number) {
    int rounded = (number / 5).round() * 5; // Round to the nearest multiple of 5
    return rounded.clamp(15, 45); // Ensure the value stays between 15 and 45
  }

 static int roundToNearestFiveAge(int number) {
    int rounded = (number / 5).round() * 5;

    // Ensure the value is within the range [50, 90]
    if (rounded < 50) return 50;
    if (rounded > 90) return 90;

    return rounded;
  }



