  // Method to get AGE by multiple parameters
  String getTenYearOsteoporoticFracture(String GENDER, String FRAX,String TYPE,String CRF,String COLUMN,String AGE) {
    var row = tableData_Osteoporotic.firstWhere(
          (element) => element["GENDER"] == GENDER && element["FRAX"] == FRAX && element["TYPE"] == TYPE && element["CRF"] == CRF && element["COLUMN"] == COLUMN && element["AGE"] == AGE,
      orElse: () => {},
    );
    return row.isNotEmpty ? row["Value"] ?? "Not Found" : "Not Found";
  }

  // for hip
  String getTenYearHipFracture(String GENDER, String FRAX,String TYPE,String CRF,String COLUMN,String AGE) {
    var row = tableData_Hip.firstWhere(
          (element) => element["GENDER"] == GENDER && element["FRAX"] == FRAX && element["TYPE"] == TYPE && element["CRF"] == CRF && element["COLUMN"] == COLUMN && element["AGE"] == AGE,
      orElse: () => {},
    );
    return row.isNotEmpty ? row["Value"] ?? "Not Found" : "Not Found";
  }

  static double roundToNearestIntervalTsore(double number) {
    double interval = 0.5;
    double rounded = (number / interval).roundToDouble() * interval;

    // Avoid returning 0.0
    if (rounded == 0.0) {
      rounded = -0.5;
    }

    // Clamp the value between -4.0 and 1.0
    return rounded.clamp(-4.0, 1.0).toDouble();
  }


